CREATE DATABASE Measure_Up_DB;
CREATE TABLE olympic_record_db(
Gender Varchar(255),
Event Varchar(255),
Location Varchar(255),
Year int,
Medal Varchar(1),
First_Name Varchar(255),
Last_Name Varchar(255),
Nationality Varchar(3),
Result Varchar(255));
CREATE TABLE 10000M_Men AS
SELECT Gender,Event,Location,Year,Medal,First_Name,Nationality,Result
FROM olympic_record_db
WHERE Event = '10000M Men';
CREATE TABLE 100M_Men AS
SELECT Gender,Event,Location,Year,Medal,First_Name,Nationality,Result
FROM olympic_record_db
WHERE Event = '100M Men';
CREATE TABLE 200M_Men AS
SELECT Gender,Event,Location,Year,Medal,First_Name,Nationality,Result
FROM olympic_record_db
WHERE Event = '200M Men';
CREATE TABLE 400M_Men AS
SELECT Gender,Event,Location,Year,Medal,First_Name,Nationality,Result
FROM olympic_record_db
WHERE Event = '400M Men';
CREATE TABLE 800M_Men AS
SELECT Gender,Event,Location,Year,Medal,First_Name,Nationality,Result
FROM olympic_record_db
WHERE Event = '800M Men';
CREATE TABLE 110M_Hurdles_Men AS
SELECT Gender,Event,Location,Year,Medal,First_Name,Nationality,Result
FROM olympic_record_db
WHERE Event = '110M Hurdles Men';
CREATE TABLE 1500M_Men AS
SELECT Gender,Event,Location,Year,Medal,First_Name,Nationality,Result
FROM olympic_record_db
WHERE Event = '1500M Men';
